    double const dG_1_dL = (1.0/4.0)*pow(alpha, 2)*pow(mu, 2)*(pow(G, 2) - pow(H, 2))*(G*pow(G + L, 2)*(3*cos(f + 2*g) + cos(3*f + 2*g)) + L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(-4*G + L)*(G + L)*cos(2*g) + L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(G - L)*(2*G + L)*cos(2*g))/(pow(G, 4)*pow(L, 3)*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*pow(G + L, 2));
    double const dG_1_dG = (1.0/4.0)*pow(alpha, 2)*pow(mu, 2)*(-pow(G, 2)*pow(G + L, 2)*(pow(G, 2) - pow(H, 2))*(3*cos(f + 2*g) + cos(3*f + 2*g)) - G*L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(G - L)*(2*G + L)*(pow(G, 2) - pow(H, 2))*cos(2*g) + G*L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(G + L)*(4*G - L)*(pow(G, 2) - pow(H, 2))*cos(2*g) + 2*pow(H, 2)*pow(L, 2)*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*pow(G + L, 2)*(3*sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(f + 2*g) + sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(3*f + 2*g) + 3*cos(2*f + 2*g)) + 2*pow(H, 2)*L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(G - L)*(G + L)*(2*G + L)*cos(2*g) - 3*L*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*(G + L)*(pow(G, 2) - pow(H, 2))*(L*(G + L)*(3*sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(f + 2*g) + sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(3*f + 2*g) + 3*cos(2*f + 2*g)) + (G - L)*(2*G + L)*cos(2*g)))/(pow(G, 6)*pow(L, 2)*sqrt((-pow(G, 2) + pow(L, 2))/pow(L, 2))*pow(G + L, 2));
    double const dG_1_dH = (1.0/2.0)*H*pow(alpha, 2)*pow(mu, 2)*(-L*(G + L)*(3*sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(f + 2*g) + sqrt(-pow(G, 2)/pow(L, 2) + 1)*cos(3*f + 2*g) + 3*cos(2*f + 2*g)) - (G - L)*(2*G + L)*cos(2*g))/(pow(G, 5)*L*(G + L));

